						["custom"] = "function()\n    for unit in aura_env.GroupMembers() do\n        if\n        aura_env.RangeCheck(unit, 5) and not UnitIsUnit(unit, \"player\") and not UnitIsDeadOrGhost(unit) and not UnitIsDeadOrGhost(\"player\")\n        then \n            return true\n        end\n    end\nend",
