		["Target_Time_to_Die_Hunter"] = {
			["outline"] = "OUTLINE",
			["authorOptions"] = {
			},
			["displayText"] = "%c",
			["customText"] = "function()\n    if aura_env.healthrate and aura_env.healthrate < 0 then  \n        local seconds = math.floor(aura_env.healthrate_ttd)\n        local minutes = math.floor(seconds / 60)\n        seconds = seconds-(minutes*60)\n        if seconds < 10 then\n            seconds = \"0\"..seconds;\n        end\n        --return format(\"%.0f\",aura_env.healthrate_ttd) .. \"s\"\n        if minutes == 0 then \n            return seconds\n        else\n            return minutes..\":\"..seconds\n        end\n    else\n        return \"\"\n    end\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["customTextUpdate"] = "update",
			["automaticWidth"] = "Auto",
			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["custom"] = "aura_env.trackedUnit = \"target\"\naura_env.trackedPercent = 0 -- 0 for 0%, 20 for 20% , 35 for 35% etc\naura_env.refreshRate = 0.25\naura_env.numEntries = 40 --number of entries the WA stores to calculate TTD\n\n\n\n\n\n\n\n\n\n\n\n\n",
					["do_custom"] = true,
				},
				["finish"] = {
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["custom_hide"] = "timed",
						["unevent"] = "auto",
						["custom_type"] = "status",
						["genericShowOn"] = "showOnActive",
						["event"] = "Health",
						["unit"] = "target",
						["use_unit"] = true,
						["subeventPrefix"] = "SPELL",
						["spellIds"] = {
						},
						["custom"] = "function()\n    aura_env.healthrate_time = aura_env.healthrate_time or 0\n    aura_env.healthrate_index = aura_env.healthrate_index or 0\n    aura_env.healthrate_tar = aura_env.healthrate_tar or {}\n    aura_env.healthrate_pct = aura_env.healthrate_pct or {}\n    aura_env.healthrate_rate = aura_env.healthrate_rate or {}\n    \n    local tar = UnitGUID(aura_env.trackedUnit)\n    if tar and UnitExists(aura_env.trackedUnit) then\n        if GetTime() >= aura_env.healthrate_time then\n            local pct = (UnitHealth(aura_env.trackedUnit)/UnitHealthMax(aura_env.trackedUnit)*100)-aura_env.trackedPercent\n            local rate\n            if aura_env.healthrate_tar[(aura_env.healthrate_index+1)%aura_env.numEntries] and aura_env.healthrate_tar[(aura_env.healthrate_index+1)%aura_env.numEntries] == tar then\n                rate = ((pct - aura_env.healthrate_pct[(aura_env.healthrate_index+1)%aura_env.numEntries])/aura_env.numEntries)/aura_env.refreshRate\n                local count = 0\n                local accumulator = 0\n                for _,v in pairs(aura_env.healthrate_rate) do\n                    count = count + 1\n                    accumulator = accumulator + v\n                end\n                if count > 0 then\n                    aura_env.healthrate = accumulator/count\n                    aura_env.healthrate_ttd = -pct/aura_env.healthrate\n                end                \n            else\n                aura_env.healthrate = nil\n            end\n            \n            aura_env.healthrate_index = (aura_env.healthrate_index+1)%aura_env.numEntries\n            aura_env.healthrate_tar[aura_env.healthrate_index] = tar\n            aura_env.healthrate_pct[aura_env.healthrate_index] = pct\n            aura_env.healthrate_rate[aura_env.healthrate_index] = rate\n            \n            aura_env.healthrate_time = GetTime() + aura_env.refreshRate\n            aura_env.healthrate_lasttar = tar\n        end\n        \n        if tar == aura_env.healthrate_lasttar and UnitCanAttack(\"player\",aura_env.trackedUnit) then\n            return true\n        end\n    end\nend",
