					["custom"] = "aura_env.trackedUnit = \"target\"\naura_env.trackedPercent = 0 -- 0 for 0%, 20 for 20% , 35 for 35% etc\naura_env.refreshRate = 0.25\naura_env.numEntries = 40 --number of entries the WA stores to calculate TTD\n\n\n\n\n\n\n\n\n\n\n\n\n",
					["do_custom"] = true,
				},
