				["init"] = {
					["custom"] = "-- Config\naura_env.glowInBuffer = false\n\naura_env.bufferDuration = 2.5 -- Maximum duration for the buffer (recommended area that you refresh the buff in, since it's not always going to happen at 0.1 sec remaining)\naura_env.bufferColor = {\n    [\"r\"] = 1,\n    [\"g\"] = 1,\n    [\"b\"] = 1,\n    [\"a\"] = 0.5\n}\n\n\n-- Adjust expiration time to be whichever is sooner, the spell capping at 2 stacks, or the default tracking\n-- By default, only the time until the buff expires from the pet or the buff being down and waiting for sufficient charges to reach 3 stacks is tracked.\naura_env.trackMaxCharges = false\n\n-- Don't edit below here\naura_env.spellId = 217200\naura_env.buffId = 272790\naura_env.durationUpdateQueued = true\naura_env.duration = 20\n\naura_env.buff = {}\naura_env.spell = {}\n\n-- Buff Functions\nfunction aura_env.buff.Update(self, buffId)\n    self.duration = 0\n    self.expirationTime = 0\n    self.stacks = 0\n    for i= 1, 40 do\n        local name, _, count, _, duration, expirationTime, _, _, _, spellId = UnitBuff(\"pet\", i, \"PLAYER\")\n        if spellId == buffId then\n            self.duration = duration\n            self.expirationTime = expirationTime\n            self.stacks = count\n            break\n        end\n    end\nend\n\n-- Spell Functions\nfunction aura_env.spell.Update(self, spellId)\n    self.charges, self.maxCharges, self.cooldownStart, self.cooldownDuration = GetSpellCharges(spellId)\n    self.cooldownRemaining = self.cooldownStart + self.cooldownDuration - GetTime()\nend\n\nfunction aura_env.spell.GetTimeUntilOneCharge(self)\n    -- Return 0 if we have more than one charge, otherwise cd\n    return self.charges < 1 and self.cooldownRemaining or 0\nend\n\nfunction aura_env.spell.GetTimeUntilMaxCharges(self)\n    local timeUntilMaxCharges = 0\n    if self.charges < self.maxCharges then\n        -- Add cooldown on current charge to the cd on the remaining charges\n        timeUntilMaxCharges = self.cooldownRemaining + (self.cooldownDuration * (self.maxCharges - self.charges - 1))\n    end\n    return timeUntilMaxCharges\nend\n\nfunction aura_env.GetTimeUntilNextCast(self)\n    local timeUntilOneCharge = self.spell:GetTimeUntilOneCharge()\n    local timeUntilMaxCharges = self.spell:GetTimeUntilMaxCharges()\n    \n    -- Pet buff\n    local timeUntilStackRefresh \n    if self.buff.expirationTime and self.buff.expirationTime - GetTime() > timeUntilOneCharge then\n        timeUntilStackRefresh = self.buff.expirationTime - GetTime()\n    else\n        -- Re-apply buff at 1.8 charges if it falls off (from simc apl)\n        -- Buffer area begins at 1.4, end is actually that + bufferDuration\n        local bufferDuration = math.min(aura_env.bufferDuration, self.spell.cooldownDuration * 0.2)\n        timeUntilStackRefresh = math.max(-bufferDuration, timeUntilMaxCharges - self.spell.cooldownDuration * 0.2) + bufferDuration\n    end\n    \n    if aura_env.trackMaxCharges then\n        timeUntilStackRefresh = math.min(timeUntilStackRefresh, timeUntilMaxCharges)\n    end\n    \n    return timeUntilStackRefresh, timeUntilOneCharge\nend\n\nfunction aura_env.GetBufferPercent(self, timeUntilNextCast)\n    local timeUntilOneCharge = self.spell:GetTimeUntilOneCharge()\n    \n    local noChargeTime = timeUntilOneCharge > 0 and timeUntilNextCast - timeUntilOneCharge or self.bufferDuration\n    \n    local bufferPercent = math.min(noChargeTime, self.bufferDuration) / self.duration\n    if timeUntilNextCast == 0 then\n        bufferPercent = 1\n    end\n    \n    return bufferPercent\nend\n\n-- Overlays\nlocal region = WeakAuras.regions[aura_env.id].region\nregion.bufferSpinner = region.bufferSpinner or WeakAuras.createSpinner(region, \"OVERLAY\", region:GetFrameLevel() + 1)\nregion.bufferSpinner:SetTexture(\"Interface\\\\CHATFRAME\\\\CHATFRAMEBACKGROUND\")\nregion.bufferSpinner:Color(aura_env.bufferColor[\"r\"], aura_env.bufferColor[\"g\"], aura_env.bufferColor[\"b\"], aura_env.bufferColor[\"a\"])\n\nregion.bufferSpinner:SetProgress(region, 300, 360)",
					["do_custom"] = true,
				},
