			["triggers"] = {
				{
					["trigger"] = {
						["subeventSuffix"] = "_CAST_START",
						["type"] = "custom",
						["event"] = "Health",
						["custom_type"] = "status",
						["subeventPrefix"] = "SPELL",
						["custom"] = "function()\n    return true\nend\n\n\n\n\n\n\n\n",
						["genericShowOn"] = "showOnActive",
						["customStacks"] = "function()\n    return aura_env.buff.stacks or 0\nend",
						["customDuration"] = "function()\n    aura_env.buff:Update(aura_env.buffId)\n    aura_env.spell:Update(aura_env.spellId)\n    \n    local timeUntilNextCast, timeUntilOneCharge = aura_env:GetTimeUntilNextCast()\n    \n    if aura_env.duration < timeUntilNextCast then\n        aura_env.durationUpdateQueued = true\n    end\n    \n    if aura_env.durationUpdateQueued then\n        aura_env.duration = timeUntilNextCast\n        aura_env.durationUpdateQueued = false\n    end\n    \n    local bufferPercent = aura_env:GetBufferPercent(timeUntilNextCast)\n    \n    local region = WeakAuras.regions[aura_env.id].region\n    if bufferPercent >= 0 and bufferPercent <= 1 then\n        region.bufferSpinner:Show()\n        region.bufferSpinner:SetProgress(region, (1 - bufferPercent) * 360, 360)\n    else\n        region.bufferSpinner:Hide()\n    end\n    \n    if aura_env.duration <= 0 or timeUntilNextCast <= 0 then\n        return 0, 0\n    else \n        return aura_env.duration, GetTime() + timeUntilNextCast\n    end\nend",
