			["customText"] = "function()\n    if  aura_env.saveEpositionOnPing then\n        \n        return string.format('%.f', aura_env.saveEpositionOnPing)\n    else\n        return ('')\n    end\n    \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
