						["custom_type"] = "status",
						["type"] = "custom",
						["use_eclipsetype"] = true,
						["subeventSuffix"] = "_CAST_START",
						["event"] = "Conditions",
						["eclipsetype"] = "moon",
						["lunar_power_operator"] = ">=",
						["spellIds"] = {
						},
						["customDuration"] = "function()\n    local myEnergyType = 11             -- сюда свой тип энергии\n    if aura_env.add_eng ~=nil \n    then\n        local WA_adding_ELENCH_cast_eng\n        local isSpiritWolf = 0\n        for i = 1,40 do                  --здесь проверка на бафф призрачного волка\n            local _, _, _, _, _, _, _, _, _,_, spellId = UnitBuff(\"player\", i)\n            if spellId == 2645 \n            then \n                isSpiritWolf = 1\n                break\n            end\n        end\n        \n        if isSpiritWolf == 0\n        then\n            \n            local energy_Position = UnitPower('player',myEnergyType)+aura_env.add_eng;\n            local energy_MaxPosition = UnitPowerMax(\"player\", myEnergyType);\n            \n            if aura_env.stTime and aura_env.edTime\n            then\n                WA_adding_ELENCH_cast_eng = aura_env.add_eng*(GetTime()*1000 -aura_env.stTime)/(aura_env.edTime-aura_env.stTime)\n            end\n            \n            if aura_env.edTime ~= nil\n            then\n                aura_env.saveEpositionOnPing =  energy_Position\n                aura_env.saveTpositionOnPing = GetTime()\n            end\n            \n            if aura_env.edTime == nil and aura_env.saveTpositionOnPing and aura_env.saveTpositionOnPing >0\n            then\n                if aura_env.myApprPing+aura_env.saveTpositionOnPing > GetTime()\n                then\n                    energy_Position = aura_env.saveEpositionOnPing\n                    WA_adding_ELENCH_cast_eng = aura_env.saveEpositionOnPing-UnitPower('player',myEnergyType)\n                end\n            end\n            \n            WeakAuras.ScanEvents(\"WA_event_engUpdate_by_Afreg\", WA_adding_ELENCH_cast_eng)\n            \n            aura_env.SpWolfCur = energy_Position\n            aura_env.SpWolfMax = energy_MaxPosition\n            \n            if energy_Position>energy_MaxPosition\n            then\n                return energy_MaxPosition, energy_MaxPosition, 0,0 \n            else\n                return energy_Position, energy_MaxPosition, 0,0\n            end\n        else\n            if aura_env.SpWolfCur \n            then\n                return aura_env.SpWolfCur, aura_env.SpWolfMax, 0,0\n            else\n                return 0, 1, 0,0\n            end\n        end\n        \n    else\n        return 0, energy_MaxPosition, 0,0 \n    end\n    \nend",
						["unevent"] = "auto",
						["events"] = "COMBAT_LOG_EVENT_UNFILTERED",
						["custom"] = "function()\n    \n    aura_env.myApprPing  = 0.2                -- Твой примерный пинг, можно больше\n    \n    --Касты, генерирующие энергию, для каждого класса свои\n    \n    local MYspell_1                                           -- lightning\n    local MYspell_2                                           -- LB\n    local MYspell_3                                           -- IceFury\n    \n    \n    -- Первая часть, тут проверяем модификаторы накопления энергии (таланты, бурсты, меняющие количество получаемой энергии со способности\n    -- Кастомна для каждого класса\n    \n    MYspell_1 = 8\n    MYspell_2 = 10\n    MYspell_3 = 25\n    \n    -- Часть вторая, проверяем, кастует ли персонаж, если да, то генерирующий ли энергию спелл\n    \n    local spellName, _, _, _, startTime, endTime = UnitCastingInfo(\"player\")\n    \n    if spellName then \n        local _,_, _, _, _, _, spellID = GetSpellInfo(spellName)\n        aura_env.stTime = startTime\n        aura_env.edTime = endTime\n        -- Перечисляем генераторы энергии и количество генерируемой энергии\n        if(spellID == 188196) \n        then \n            aura_env.add_eng=MYspell_1\n        elseif(spellID == 51505) \n        then \n            aura_env.add_eng=MYspell_2\n        elseif(spellID == 210714)\n        then\n            aura_env.add_eng=MYspell_3\n        else \n            aura_env.add_eng=0\n        end\n    else\n        aura_env.stTime = nil\n        aura_env.edTime = nil\n        aura_env.add_eng=0\n    end\n    \n    -- Хрень с учетом пинга\n    \n    if aura_env.saveEpositionOnPing == nil\n    then \n        aura_env.saveEpositionOnPing = 0\n        aura_env.saveTpositionOnPing =0\n    end\n    \n    \n    return true\nend",
