						["events"] = "UNIT_POWER_UPDATE, NAME_PLATE_UNIT_ADDED NAME_PLATE_UNIT_REMOVED",
						["custom"] = "function(states, event, unit, ...)\n    if event == \"NAME_PLATE_UNIT_ADDED\" and unit then\n        local GUID = UnitGUID(unit)\n        local npcID = select(6, strsplit(\"-\", GUID))\n        if aura_env.npcID[tonumber(npcID)] then\n            local name = UnitName(unit)\n            local power = UnitPower(unit)\n            local maxPower = UnitPowerMax(unit)\n            \n            states[unit] = {\n                name = name,\n                unit = unit,\n                frame = C_NamePlate.GetNamePlateForUnit(unit),\n                icon = [[Interface\\AddOns\\WeakAuras\\Media\\Textures\\Circle_White_Border]],\n                progressType = \"static\",\n                value = power,\n                total = maxPower,\n                autoHide = false,\n                changed = true,\n                show = true,\n            }\n        end\n        \n    elseif event == \"NAME_PLATE_UNIT_REMOVED\" then\n        if states[unit] then\n            states[unit].show = false\n            states[unit].changed = true\n        end\n    end\n    \n    if event == \"UNIT_POWER_UPDATE\" then\n        if states[unit] then\n            states[unit].value = UnitPower(unit)\n            states[unit].changed = true\n        end\n    end\n    \n    return true\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
