					["colorB"] = 1,
					["colorG"] = 1,
					["alphaFunc"] = "function(progress, start, delta)\n    if aura_env.state and aura_env.state.frame then\n        aura_env.region:ClearAllPoints()\n        aura_env.region:SetPoint(\"BOTTOM\", aura_env.state.frame, \"TOP\", 0, 4) \n        if aura_env.state.value >= aura_env.limit then return 1 else return 0 end\n    end\n    return 0\nend\n\n\n\n\n\n\n\n\n",
					["use_alpha"] = true,
