					["colorFunc"] = "function(progress, r1, g1, b1, a1, r2, g2, b2, a2)\n    if aura_env.state and aura_env.state.value then\n        local r1, g1, b1 = 1, 0, 0\n        local r2, g2, b2 = 0, 1, 0\n        local progress = 1 - ClampedPercentageBetween(aura_env.state.value, aura_env.state.value*0.2, aura_env.state.total)\n        local red, green, blue = r1 + (progress * (r2 - r1)), g1 + (progress * (g2 - g1)), b1 + (progress * (b2 - b1))\n        return red, green, blue, 0.7\n    end\n    return r1, g1, b1, a1\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
