				["init"] = {
					["custom"] = "aura_env.FriendlyTargets = {\n    keys = {\n        [5] = 37727,\n        [6] = 63427,\n        [7] = 61323,\n        [8] = 34368,\n        [10] = 32321,\n        [15] = 1251,\n        [20] = 21519,\n        [25] = 31463,\n        [30] = 1180,\n        [35] = 18904,\n        [38] = 140786,\n        [40] = 34471,\n        [45] = 32698,\n        [50] = 116139,\n        [60] = 32825,\n        [70] = 41265,\n        [80] = 35278,\n        [90] = 133925,\n        [100] = 41058,\n        [150] = 6954,\n        [200] = 75208\n    },\n    {0, 1},\n    {5, 37727},\n    {6, 63427},\n    {7, 61323},\n    {8, 34368},\n    {10, 32321},\n    {15, 1251},\n    {20, 21519},\n    {25, 31463},\n    {30, 1180},\n    {35, 18904},\n    {38, 140786},\n    {40, 34471},\n    {45, 32698},\n    {50, 116139},\n    {60, 32825},\n    {70, 41265},\n    {80, 35278},\n    {90, 133925},\n    {100, 41058},\n    {150, 6954},\n    {200, 75208}\n}\n\n\nfunction aura_env.GroupMembers(reversed, forceParty)\n    local unit  = (not forceParty and IsInRaid()) and 'raid' or 'party'\n    local numGroupMembers = forceParty and GetNumSubgroupMembers()  or GetNumGroupMembers()\n    local i = reversed and numGroupMembers or (unit == 'party' and 0 or 1)\n    return function()\n        local ret \n        if i == 0 and unit == 'party' then \n            ret = 'player'\n        elseif i <= numGroupMembers and i > 0 then\n            ret = unit .. i\n        end\n        i = i + (reversed and -1 or 1)\n        return ret\n    end\nend\n\n\naura_env.RangeCheck = function(unit, range)\n    if not UnitExists(unit) then return end\n    local t = {}\n    if not UnitCanAttack(\"player\", unit) then\n        t = aura_env.FriendlyTargets\n    end\n    \n    if range then\n        if not t.keys[range] then return end\n        if IsItemInRange(t.keys[range], unit) then\n            return true\n        else\n            return false\n        end\n    else\n        for i=1, #t do\n            if IsItemInRange(t[i][2], unit) then\n                return t[i-1][1] .. \"-\" .. t[i][1]\n            end\n        end\n    end\nend\n\n\n\n\n\n\n\n\n\n\n\n",
