		["Name on Nameplate"] = {
			["outline"] = "OUTLINE",
			["parent"] = "Nameplate Targeted",
			["displayText"] = "%c",
			["customText"] = "function()\n    if aura_env.state and aura_env.state.castingUnit then\n        local region = WeakAuras.GetRegion(aura_env.id, aura_env.cloneId)\n        local nameplate = C_NamePlate.GetNamePlateForUnit(aura_env.state.castingUnit)\n        if nameplate then\n            region:ClearAllPoints()\n            region:SetPoint(aura_env.anchorPoint, nameplate, aura_env.relativePoint, aura_env.xOffset, aura_env.yOffset)\n            region:Show()\n        else\n            region:Hide()\n        end\n    end\n    \n    if aura_env.state and aura_env.state.targetName then\n        local marker = GetRaidTargetIndex(aura_env.state.targetUnit)\n        if marker == nil then\n            return aura_env.state.targetName\n        else\n            return \"|TInterface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_\"..marker..\":0|t \"..aura_env.state.targetName\n        end\n    else\n        return \"target name\"\n    end\nend",
