					["custom"] = "-- ONLY CHANGE THESE VALUES --\naura_env.spells = {} -- the spells with corresponding npcId for which to query\n-- show castbar when... showCastPlayer: ...player is targeted, showCastGroup: ...player is not targeted\n-- show name of target on nameplate when... showNamePlayer: ...player is targeted, showNameGroup: ...player is not targeted\n-- showRaidFrameIcon: show icon in raidframe when unit targeted\n-- aura_env.spells[select(1,GetSpellInfo(189116))] =\n-- {spellId = 189116, npcIds = {91860}, -- test spell (acrobatic thingymagic)\n--     showCastPlayer = true, showCastGroup = true,\n--     showNamePlayer = true, showNameGroup = true,\n-- showRaidFrameGlow = true, showRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(193633))] =\n{spellId = 193633, npcIds = {98275}, -- Shoot, Risen Archer, BRH\n    showCastPlayer = true, showCastGroup = true,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(203163))] =\n{spellId = 203163, npcIds = {102788}, -- Sic Bats!, Felspite Dominator, BRH\n    showCastPlayer = true, showCastGroup = false,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(198641))] =\n{spellId = 198641, npcIds = {98965}, -- Whirling Blade, Kur'talos Ravencrest, BRH\n    showCastPlayer = true, showCastGroup = false,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(201733))] =\n{spellId = 201733, npcIds = {98970}, -- Stinging Swarm, Latosius/Dantalionax, BRH\n    showCastPlayer = true, showCastGroup = false,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(196516))] =\n{spellId = 196516, npcIds = {100250,100249,98173,100248}, -- Lightning Blast, Nagas, EoA\n    showCastPlayer = true, showCastGroup = false,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(198595))] =\n{spellId = 198595, npcIds = {95842}, -- Thunderous Bolt, Valarjar Thundercaller, HoV\n    showCastPlayer = true, showCastGroup = true,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(191976))] =\n{spellId = 191976, npcIds = {95833}, -- Arcing Bolt, Hyrja, HoV\n    showCastPlayer = true, showCastGroup = true,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(193659))] =\n{spellId = 193659, npcIds = {95675}, -- Felblaze Rush, Skovald, HoV\n    showCastPlayer = true, showCastGroup = false,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(183633))] =\n{spellId = 183633, npcIds = {91008,102232}, -- Jagged Disc, Rockbound Pelter/Trapper, NL\n    showCastPlayer = true, showCastGroup = true,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(186269))] =\n{spellId = 186269, npcIds = {90998}, -- Stone Bolt, Blightshard Shaper, NL\n    showCastPlayer = true, showCastGroup = false,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(236737))] =\n{spellId = 236737, npcIds = {118690,120550,120778}, -- Fel Strike, Wrathguard Invader, CoEN\n    showCastPlayer = true, showCastGroup = true,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(238489))] =\n{spellId = 238489, npcIds = {118801}, -- Fel Blast, Imp, CoEN\n    showCastPlayer = false, showCastGroup = false,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(228526))] =\n{spellId = 228526, npcIds = {114783}, -- Flirt, Reformed Maiden, LK\n    showCastPlayer = false, showCastGroup = false,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(227809))] =\n{spellId = 227809, npcIds = {113971}, -- Holy Bolt, Maiden of Virtue, LK\n    showCastPlayer = true, showCastGroup = true,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(228011))] =\n{spellId = 228011, npcIds = {114522}, -- Soup Spray, Mrs. Cauldrons, LK\n    showCastPlayer = true, showCastGroup = false,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\naura_env.spells[select(1,GetSpellInfo(201400))] =\n{spellId = 201400, npcIds = {100527}, -- Dread Inferno, Dreadfire Imp, DhT\n    showCastPlayer = true, showCastGroup = false,\n    showNamePlayer = true, showNameGroup = true,\nshowRaidFrameIcon = true}\n-- END OF INPUT --\n\naura_env.whatToShow = function(spellName, castingUnit, targetUnit)\n    spell = aura_env.spells[spellName]\n    if spell == nil then\n        return nil\n    end\n    local guid = UnitGUID(castingUnit)\n    local _, _, _, _, _, npc_id, _ = strsplit(\"-\",guid)\n    local castingNpcId = tonumber(npc_id)\n    for k,npcId in pairs(spell.npcIds) do\n        if npcId == castingNpcId then\n            local isPlayer = UnitIsUnit(targetUnit, \"player\")\n            local showCast = (isPlayer and spell.showCastPlayer) or ((not isPlayer) and spell.showCastGroup)\n            local showName = (isPlayer and spell.showNamePlayer) or ((not isPlayer) and spell.showNameGroup)\n            local showRaidFrameIcon = spell.showRaidFrameIcon\n            return showCast, showName, showRaidFrameIcon\n        end\n    end\n    return nil\nend\n\naura_env.GetFrame = function(target)\n    if not UnitExists(target) then\n        if type(target) == \"string\" and target:find(\"Player\") then\n            target = select(6,GetPlayerInfoByGUID(target))\n        else\n            return null\n        end\n    end \n    -- ShadowUF\n    if IsAddOnLoaded(\"ShadowedUnitFrames\") then\n        if ShadowUF.enabledUnits.raid then\n            for _,frame in pairs(ShadowUF.Units.unitFrames) do\n                if frame.unitType == \"raid\" and frame:IsVisible() and frame.unit and UnitIsUnit(frame.unit, target)\n                then\n                    return frame\n                end\n            end\n        end\n    end\n    -- CompactRaid\n    if IsAddOnLoaded(\"CompactRaid\") then\n        return CompactRaid:FindUnitFrame(target)\n    end\n    -- Healbot\n    if IsAddOnLoaded(\"HealBot\") then\n        for _,frame in pairs(HealBot_Unit_Button) do\n            if UnitIsUnit(frame.unit, target) then\n                return frame\n            end\n        end\n    end\n    -- Vuhdo\n    if IsAddOnLoaded(\"VuhDo\") and VUHDO_CONFIG[\"SHOW_PANELS\"] then\n        for _, v in pairs(VUHDO_UNIT_BUTTONS) do\n            if v[1].raidid and UnitIsUnit(v[1].raidid, target) then\n                return v[1]\n            end \n        end\n    end\n    if IsAddOnLoaded(\"Grid\") then\n        for _, frame in pairs(Grid.modules.GridFrame.registeredFrames) do\n            if frame:IsVisible() then\n                if frame.unit and UnitIsUnit(frame.unit, target) then\n                    return frame\n                end\n            end\n        end\n    end\n    -- Grid2\n    if IsAddOnLoaded(\"Grid2\") then\n        for _, frame in pairs(Grid2Frame.registeredFrames) do\n            if frame:IsVisible() then\n                if frame.unit and UnitIsUnit(frame.unit, target) then\n                    return frame\n                end\n            end\n        end\n    end\n    -- ElvUI\n    if ElvUF then\n        for _,frame in pairs(ElvUF.objects) do\n            if (frame.unitframeType == \"raid\" \n                or frame.unitframeType == \"party\" \n                or frame.unitframeType == \"raid40\"\n            )\n            and frame:IsVisible() and frame.unit and UnitIsUnit(frame.unit, target)\n            then\n                return frame\n            end\n        end\n    end\n    -- bdGrid\n    if IsAddOnLoaded(\"bdGrid\") then\n        for _,frame in pairs(oUF_bdGridRaid) do\n            if UnitIsUnit(frame.unit, target) then\n                return frame\n            end\n        end\n    end\n    -- Lastly, default frames\n    if CompactRaidFrameContainer.groupMode == \"flush\" then\n        for _,frame in pairs(CompactRaidFrameContainer.flowFrames) do\n            if frame.unit and frame:IsVisible() and UnitIsUnit(frame.unit, target) then\n                return frame\n            end\n        end\n    else\n        for i = 1,8 do\n            for j = 1,5 do\n                local frame = _G[\"CompactRaidGroup\"..i..\"Member\"..j]\n                if frame and frame:IsVisible() and frame.unit and UnitIsUnit(frame.unit, target)\n                then\n                    return frame\n                end\n            end\n        end\n    end\n    -- debug - uncomment below if you're seeing issues\n    -- print(\"GlowOnDemand (WA) - No frame found. Target sent: \".. target)\nend",
