						["custom"] = "function()\n    for i=1,40 do\n        local unit = \"nameplate\"..i\n        local targetUnit = unit..\"-target\"\n        if UnitExists(unit) and UnitExists(targetUnit) then\n            local spellName = nil\n            local spellIcon = nil\n            local castStart = nil\n            local castEnd = nil\n            if UnitCastingInfo(unit) then\n                spellName = select(1,UnitCastingInfo(unit))\n                spellIcon = select(4,UnitCastingInfo(unit))\n                castStart = select(5,UnitCastingInfo(unit))\n                castEnd = select(6,UnitCastingInfo(unit))\n            elseif UnitChannelInfo(unit) then\n                spellName = select(1,UnitChannelInfo(unit))\n                spellIcon = select(4,UnitChannelInfo(unit))\n                castStart = select(5,UnitChannelInfo(unit))\n                castEnd = select(6,UnitChannelInfo(unit))\n            end\n            if spellName then\n                local showCast, showName, showRaidFrameIcon = aura_env.whatToShow(spellName, unit, targetUnit)\n                if showCast then\n                    WeakAuras.ScanEvents(\"NAMEPLATE_CASTCHANNEL\", spellName, targetUnit, spellIcon, castStart/1000, castEnd/1000, i)\n                else\n                    WeakAuras.ScanEvents(\"NAMEPLATE_NOCAST\", i)\n                end\n                if showName then\n                    WeakAuras.ScanEvents(\"NAMEPLATE_NAME\", unit, targetUnit, i)\n                else\n                    WeakAuras.ScanEvents(\"NAMEPLATE_NONAME\", i)\n                end\n                if showRaidFrameIcon and aura_env.GetFrame(targetUnit) then\n                    WeakAuras.ScanEvents(\"RAIDFRAME_ICON\", aura_env.GetFrame(targetUnit), spellIcon, castStart/1000, castEnd/1000, i)\n                else\n                    WeakAuras.ScanEvents(\"RAIDFRAME_NOICON\", i)\n                end\n            else\n                WeakAuras.ScanEvents(\"NAMEPLATE_NOCAST\", i)\n                WeakAuras.ScanEvents(\"NAMEPLATE_NONAME\", i)\n                WeakAuras.ScanEvents(\"RAIDFRAME_NOICON\", i)\n            end\n        else\n            WeakAuras.ScanEvents(\"NAMEPLATE_NOCAST\", i)\n            WeakAuras.ScanEvents(\"NAMEPLATE_NONAME\", i)\n            WeakAuras.ScanEvents(\"RAIDFRAME_NOICON\", i)\n        end\n    end\n    \n    return false\nend",
